// App.js

import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Navbar from "./Nav/Navbar"; // Assuming Navbar is in a file named Navbar.js
import Home from "./Home/Home"; // Assuming Home is in a file named Home.js
import About from "./About/About"; // Assuming About is in a file named About.js
import Footer from "./Footer/Footer"; // Assuming Footer is in a file named Footer.js
import Login from "./Login/Login"; // Assuming Login is in a file named Login.js

function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/login" element={<Login />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
